        int si, sj; // starting position
        int ei, ej; // ending position
        for(int i = 0; i < n; ++i) {
            for(int j = 0; j < m; ++j) {
                cin >> mat[i][j];
                if(mat[i][j] == 'S') {
                    si = i;
                    sj = j;
                }
                if(mat[i][j] == 'E') {
                    ei = i;
                    ej = j;
                }
            }
        }
        for(int i = 0; i < n; ++i) {
            for(int j = 0; j < m; ++j) {
                dist[i][j] = INF;
            }
        }
        bfs(ei, ej);
        int health = 100;
        for(int i = 0; i < n; ++i) {
            for(int j = 0; j < m; ++j) {
                if(mat[i][j] >= '0' and mat[i][j] <= '9') {
                    if(dist[i][j] <= dist[si][sj]) {
                        health -= (mat[i][j] - '0');
                    }
                }
            }
        }
        cout << max(health, 0) << endl;
    }
    return 0;
}

